import React, {Component} from 'react';
import Footer from "../Footer";

class Blog extends Component {
    render() {
        return (
            <div>
                <p>Blog</p>
                <br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>
                <Footer/>
            </div>
        );
    }
}

export default Blog;
